import "./Main.scss";
import { Routes, Route } from "react-router-dom";
import Home from "../../MainComponent/Home/Home.jsx";

function Main() {
  return (
    <div className="main">
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </div>
  );
}

export default Main;
